import styled from 'styled-components';
import React from 'react';
import { Link } from 'react-router-dom';

const PersonalPage: React.FC = () => {
    return(
        <>
            <h2>Personal Page</h2>
            <Link to="/">
            <button type="button">메인 페이지</button>
            </Link>
            {/* 개인 페이지 이미지 노출칸 */}
        </>
    );
}

export default PersonalPage;
